-- 20131119

-- This file is derived from the IANA Language Subtag Registry
-- and the jurisdictions object at https://github.com/fbennett/mlz-jurisdictions

DROP TABLE IF EXISTS jurisdictions;
DROP TABLE IF EXISTS zlsSubtagData;
DROP TABLE IF EXISTS zlsSubtags;
DROP TABLE IF EXISTS isoTagMap;

CREATE TABLE jurisdictions (
	jurisdictionID TEXT PRIMARY KEY,
	jurisdictionName TEXT NOT NULL
);
CREATE INDEX jurisdictions_param ON jurisdictions(jurisdictionName);


DROP TABLE IF EXISTS zlsSubtagData;
DROP TABLE IF EXISTS zlsSubtags;
DROP TABLE IF EXISTS isoTagMap;

CREATE TABLE isoTagMap (
	iso TEXT PRIMARY KEY,
	iana TEXT
);
CREATE TABLE zlsSubtagData (
	id INTEGER PRIMARY KEY,
	value TEXT
);
CREATE TABLE zlsSubtags (
	seq INTEGER PRIMARY KEY,
	subtag INT,
	tag INT,
	type INT,
	suppressscript INT,
	scope INT,
	preferredvalue INT,
	macrolanguage INT,
	added INT,
	description INT,
	deprecated INT,
	comment INT,
	prefix INT
);
